import React from 'react';
import ReactDOM from 'react-dom/client';
import css from "../style.css";
import { Routes, Route, Link } from "react-router-dom";
import logo from '../Images/iiitlogo.jpg'
function Heading(){
    return (
        <div className ="HeadingImg">
            <div className="Dflex">
            <div className="classlogo">
                <img id="classlogo-img"src={logo} alt="logo" />
            </div>
            <div className="link">
            <li id="Home" style={{listStyle: "none",textDecoration: "none",color: "white"}}>
            <Link to="/">Home</Link>
          </li>

          <li id="About">
            <Link style={{color:"white",listStyle: "none",textDecoration: "none"}}to="/about">About</Link>
          </li>

          <li id="Club">
            <Link to="/club">Club</Link>
          </li>
          <li id="Join">Join Classes</li>
            </div>
            </div>
        </div>
    );
}
export default Heading;
